(1, 1, '2014-09-05 08:17:34', '2014-09-05 08:17:34', 'Bienvenue dans WordPress. Ceci est votre premier article. Modifiez-le ou supprimez-le, puis lancez-vous&nbsp;!', 'Bonjour tout le monde&nbsp;!', '', 'publish', 'open', 'open', '', 'bonjour-tout-le-monde', '', '', '2014-09-05 08:17:34', '2014-09-05 08:17:34', '', 0, 'https://tut1bank.com/wd1/?p=1', 0, 'post', '', 1),
(2, 1, '2014-09-05 08:17:34', '2014-09-05 08:17:34', 'Voici un exemple de page. Elle est différente d\'un article de blog, en cela qu\'elle restera à la même place, et s\'affichera dans le menu de navigation votre site (en fonction de votre thème). La plupart des gens commencent par écrire une page « À Propos » qui les présente aux visiteurs potentiels du site. Vous pourriez y écrire quelque chose de ce tenant :\n\n...ou bien quelque chose comme ça :\n<blockquote>La société 123 Machin Truc a été créée en 1971, et n\'a cessé de proposer au public les machins-trucs de qualité depuis lors. Située à Saint-Remy-en-Bouzemont-Saint-Genest-et-Isson, 123 Machin Truc emploie 2 000 personnes, et fabrique toutes sortes de bidules super pour la communauté bouzemontoise.</blockquote>\nÉtant donné que vous êtes un nouvel utilisateur de WordPress, vous devriez vous rendre sur votre <a href=\"http://kobodayn.fr/wordpress/wp-admin/\">tableau de bord</a> pour effacer la présente page, et créer de nouvelles pages avec votre propre contenu. Amusez-vous bien !', 'Page d&rsquo;exemple', '', 'publish', 'open', 'open', '', 'page-d-exemple', '', '', '2021-11-02 14:40:24', '2021-11-02 13:40:24', '', 0, 'https://tut1bank.com/wd1/?page_id=2', 0, 'page', '', 0),
